const addData= (Url,F_Name,L_Name,Status,Role,Login,Time,id) =>{
  setData([...data,{Url,F_Name,L_Name,Status,Role,Login,Time,id}]);
}

const deleteData = (id) => {
  setData( data.filter((data) => (data.id !== id)))
}

const editData = (id,updatedData) => {
  setData(data.map((data) =>  data.id === id ?  updatedData : data ))  
}

const sortData= data.sort((a,b)=>(a.F_Name < b.F_Name ? -1 :1))



  return (
    <EmployeeContext.Provider value={{sortData , addData , deleteData , editData}}>
     {props.children}
    </EmployeeContext.Provider>
  )
